function getCodeFromFilename(filename) {
    const regex = /^(\d{2})-([a-zA-Z0-9]{3})\.usfm$/;
    const match = filename.match(regex);

    if (match) {
        return match[2];
    } else {
        return null;
    }
}
```

This function takes a filename as input and returns the three-character code or `null` if the filename doesn't match the pattern.
